import React from "react";
import Useritem from "./UserItem";
import Spinner from "../layout/spinner";
const Users = ({ users, loading }) => {
  return (
    <div style={userStyle}>
      {users.map((user) => (
        <Useritem key={user.id} user={user} />
      ))}
    </div>
  );
};
const userStyle = {
  display: "grid",
  gridTemplateColumns: "repeat(3, 1fr)",
  gridGap: "1rem",
};
export default Users;
